import React from 'react';
import MyHeader from './MyHeader';
import MyFooter from './MyFooter';
import { H2 } from 'govuk-react';
import { useState, useEffect } from 'react';

function ViewMedicalRecords() {
    function MedicalRecordsFieldset (){
        const [data, setData] = useState([]);
    }
    function useEffect() {
        const fetchData = async () => {
            try {
                const response = await axios.get('/api/medical-records');
                setData(response.data);
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();
    }

    return (
        <>
            <MyHeader/>
            <H2>VIEW MEDICAL RECORDS</H2>
            <div>
                <div class="subHeadingText">
                    <h2>Your GP Health Records</h2>
                </div>
                <div class="bodyText">
                    <p>
                        Your record shows personal data, such as your details, allergies and medications.
                    </p>
                    <p>
                        Depending on what your GP surgery shares, you may also see:
                        <ul>
                            <li>forename</li>
                            <li>surname</li>
                            <li>NHS Number</li>
                            <li>VaccineID</li>
                            <li>Dose Number</li>
                            <li>VaccinationDate</li>
                            <li>Total Number of Doses</li>
                            <li>CountryofVaccination</li>
                            <li>booster</li>
                        </ul>
                    </p>
                </div>
                
                
                <div>
                    <fieldset key={index} style={{ marginBottom: '20px' }}>
                    <legend>Medical Record {index + 1}</legend>
                      <p>
                        <strong>Forename:</strong> {record.forename}
                      </p>
                      <p>
                        <strong>Surname:</strong> {record.surname}
                      </p>
                      <p>
                        <strong>NHS Number:</strong> {record.nhsNumber}
                      </p>
                      <p>
                        <strong>Vaccine ID:</strong> {record.vaccineId}
                      </p>
                      <p>
                        <strong>Dose Number:</strong> {record.doseNumber}
                      </p>
                      <p>
                        <strong>Vaccination Date:</strong> {record.vaccinationDate}
                      </p>
                      <p>
                        <strong>Total Number of Doses:</strong> {record.totalDoses}
                      </p>
                      <p>
                        <strong>Country of Vaccination:</strong> {record.countryOfVaccination}
                      </p>
                      <p>
                        <strong>Booster:</strong> {record.booster ? 'Yes' : 'No'}
                      </p>
                    </fieldset>
                </div>  
                
            

                <br /><br />
            </div>

            <MyFooter/>
        </>
    );
}
export default ViewMedicalRecords;
